  `judul` varchar(255) NOT NULL,
  `durasi` int(10) unsigned NOT NULL,
  `tanggalRilis` date NOT NULL DEFAULT curdate(),
  PRIMARY KEY (`idSong`),
  KEY `idLabel` (`idLabel`),
