-- CONSRAINTS ii. Atribut  yang menggunakan tipe EMAIL
DELIMITER //
CREATE TRIGGER check_email_before_insert
BEFORE INSERT ON AppleID
FOR EACH ROW
BEGIN
    IF NEW.email NOT REGEXP '^(?:[a-z0-9!#$%&''*+/=?^_`{|}~-]+(?:\.[a-z0-9!#$%&''*+/=?^_`{|}~-]+)*|"(?:[\x01-\x08\x0b\x0c\x0e-\x1f\x21\x23-\x5b\x5d-\x7f]|\\[\x01-\x09\x0b\x0c\x0e-\x7f])*")@(?:(?:[a-z0-9](?:[a-z0-9-]*[a-z0-9])?\.)+[a-z0-9](?:[a-z0-9-]*[a-z0-9])?|\[(?:(?:(2(5[0-5]|[0-4][0-9])|1[0-9][0-9]|[1-9]?[0-9]))\.){3}(?:(2(5[0-5]|[0-4][0-9])|1[0-9][0-9]|[1-9]?[0-9])|[a-z0-9-]*[a-z0-9]:(?:[\x01-\x08\x0b\x0c\x0e-\x1f\x21-\x5a\x53-\x7f]|\\[\x01-\x09\x0b\x0c\x0e-\x7f])+)])$' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid email format';
    END IF;
END //

-- Relation Constraints CONSTRAINT ONE_ACTIVE_SUBSCRIPTION
DELIMITER //
CREATE TRIGGER check_one_active_subscription
BEFORE INSERT ON AppleMusicUser
FOR EACH ROW
BEGIN
    DECLARE active_count INT;

    SELECT COUNT(*)
    INTO active_count
    FROM AppleMusicUser
    WHERE email = NEW.email AND status = 'aktif';

    IF NEW.status = 'aktif' THEN
        SET active_count = active_count + 1;
    END IF;

    IF active_count > 1 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Only one active subscription is allowed per email';
    END IF;
END;
//

-- Database Constraints i. Tidak ada Musik Video yang rilis sebelum Song terkait rilis
DELIMITER //

CREATE TRIGGER before_insert_musicvideo
BEFORE INSERT ON MusicVideo
FOR EACH ROW
BEGIN
    DECLARE songReleaseDate DATE;
    SELECT tanggalRilis INTO songReleaseDate
    FROM Song
    WHERE idSong = NEW.idSong;
    IF NEW.tanggalRilis < songReleaseDate THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Music video release date cannot be before the song release date';
    END IF;
END;
//

DELIMITER ;

-- Database Constraints ii. Dalam Extra Video, pewawancara tidak bisa menjadi bintang tamu
DELIMITER //
CREATE TRIGGER before_insert_extravideo
BEFORE INSERT ON ExtraVideo
FOR EACH ROW
BEGIN
    DECLARE count_matches INT;
    SELECT COUNT(*) INTO count_matches
    FROM Menghost
    WHERE Menghost.idExtraVideo = NEW.idExtraVideo
    AND Menghost.emailHoster = NEW.emailGuestStar
    AND Menghost.idSubscriptionHoster = NEW.idSubscriptionGuestStar;
    IF count_matches > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'emailGuestStar cannot be the same as emailHoster';
    END IF;
END;
//
DELIMITER ;

-- Transition Constraints i. Status Subscription bisa berubah dari “inaktif” ke “aktif” dan sebaliknya 
DELIMITER //
CREATE TRIGGER CheckStatusSubkripsi
BEFORE UPDATE ON AppleMusicUser
FOR EACH ROW
BEGIN
    IF EXISTS (
        SELECT 1
        FROM AppleMusicUser AS old_row
        WHERE old_row.status = NEW.status
        AND old_row.status = NEW.status
        AND 
          ( old_row.status = 'aktif' AND
            NEW.status = 'inaktif' )
    ) THEN
        SIGNAL SQLSTATE '45000'
         SET MESSAGE_TEXT = 'Cannot Transition';
    END IF;
END;
//
DELIMITER ;

-- Transition constrains ii.  Jenis Subscription bisa berubah dari pelajar ke perorangan atau keluarga, perorangan ke pelajar atau keluarga, dan keluarga ke perorangan  atau pelajar.

DELIMITER //
CREATE TRIGGER CheckJenisSubkripsi
BEFORE UPDATE ON SubscriptionPlan
FOR EACH ROW
BEGIN
    IF EXISTS (
        SELECT 1
        FROM SubscriptionPlan AS old_row
        WHERE old_row.jenisSubscription = NEW.jenisSubscription
        AND 
          ( old_row.jenisSubscription = 'keluarga' AND
            NEW.jenisSubscription = 'perorangan' ) OR
          ( old_row.jenisSubscription = 'pelajar' AND
            NEW.jenisSubscription = 'perorangan' ) OR
          ( old_row.jenisSubscription = 'pelajar' AND
            NEW.jenisSubscription = 'keluarga' )
    ) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT ='Cannot transition';
    END IF;
END;
//
DELIMITER ;


-- FITUR TAMBAHAN 4A
DELIMITER //
CREATE TRIGGER validate_artist_subscription BEFORE INSERT ON Song
FOR EACH ROW
BEGIN
    DECLARE subscription_status ENUM('aktif', 'inaktif');
    
    SELECT status INTO subscription_status
    FROM AppleMusicUser
    WHERE email = NEW.emailArtist AND idSubscription = NEW.idSubscriptionArtist;

    IF subscription_status != 'aktif' THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Artis tidak memiliki langganan Apple Music aktif atau langganan telah kedaluwarsa.';
    END IF;
END;
//
DELIMITER ;


-- FITUR TAMBAHAN 4b
CREATE VIEW SongWithLyricsAndWriters AS
SELECT 
    l.idSong,
    GROUP_CONCAT(l.lyric SEPARATOR ' ') AS fullLyrics,  -- Menggabungkan semua lirik menjadi satu teks
    GROUP_CONCAT(DISTINCT CONCAT(w.email, '+', w.idSubscription) SEPARATOR ', ') AS writers -- Daftar unik penulis
FROM 
    Lyrics l
JOIN 
    AppleMusicUser w ON l.emailWriter = w.email AND l.idSubscriptionWriter = w.idSubscription
GROUP BY 
    l.idSong;

-- FITUR TAMBAHAN 4C
CREATE TABLE ArtistStatistics (
    emailArtist VARCHAR(255),
    totalLagu INT DEFAULT 0,
    totalMusikVideo INT DEFAULT 0,
    totalVideoEkstra INT DEFAULT 0,
    PRIMARY KEY (emailArtist)
);

INSERT INTO ArtistStatistics (emailArtist, totalLagu, totalMusikVideo, totalVideoEkstra)
SELECT 
    a.emailArtist,
    (SELECT COUNT(*) FROM Song WHERE emailArtist = a.emailArtist) AS totalLagu,
    (SELECT COUNT(*) FROM MusicVideo WHERE emailArtist = a.emailArtist) AS totalMusikVideo,
    (SELECT COUNT(*) FROM ExtraVideo WHERE emailGuestStar = a.emailArtist) AS totalVideoEkstra
FROM 
    (SELECT emailArtist FROM Song
     UNION
     SELECT emailArtist FROM MusicVideo
     UNION
     SELECT emailGuestStar FROM ExtraVideo) a
GROUP BY 
    a.emailArtist;


-- FITUR TAMBAHAN 4D
DELIMITER //
CREATE TRIGGER AfterInsertSong AFTER INSERT ON Song
FOR EACH ROW
BEGIN
    UPDATE ArtistStatistics
    SET totalLagu = totalLagu + 1
    WHERE emailArtist = NEW.emailArtist;

    IF ROW_COUNT() = 0 THEN
        INSERT INTO ArtistStatistics (emailArtist, totalLagu, totalMusikVideo, totalVideoEkstra)
        VALUES (NEW.emailArtist, 1, 0, 0);
    END IF;
END;
//
DELIMITER ;

DELIMITER //
CREATE TRIGGER AfterInsertMusicVideo AFTER INSERT ON MusicVideo
FOR EACH ROW
BEGIN
    UPDATE ArtistStatistics
    SET totalMusikVideo = totalMusikVideo + 1
    WHERE emailArtist = NEW.emailArtist;

    IF ROW_COUNT() = 0 THEN
        INSERT INTO ArtistStatistics (emailArtist, totalLagu, totalMusikVideo, totalVideoEkstra)
        VALUES (NEW.emailArtist, 0, 1, 0);
    END IF;
END;
//
DELIMITER ;

DELIMITER //
CREATE TRIGGER AfterInsertExtraVideo AFTER INSERT ON ExtraVideo
FOR EACH ROW
BEGIN
    UPDATE ArtistStatistics
    SET totalVideoEkstra = totalVideoEkstra + 1
    WHERE emailArtist = NEW.emailGuestStar;

    IF ROW_COUNT() = 0 THEN
        INSERT INTO ArtistStatistics (emailArtist, idSubscriptionArtist, totalLagu, totalMusikVideo, totalVideoEkstra)
        VALUES (NEW.emailGuestStar, 0, 0, 1);
    END IF;
END;
//
DELIMITER ;

-- FITUR TAMBAHAN 4E
DELIMITER //

CREATE TRIGGER validate_single_insertion BEFORE INSERT ON Memasarkan
FOR EACH ROW
BEGIN
    DECLARE produkType CHAR(6);
    DECLARE songCount INT;

    SELECT tipeProduk INTO produkType
    FROM ProdukKomersial
    WHERE idProdukKomersial = NEW.idProdukKomersial;

    SELECT COUNT(*) INTO songCount
    FROM Memasarkan
    WHERE idProdukKomersial = NEW.idProdukKomersial;

    IF produkType = 'single' AND songCount > 0 THEN
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Cannot add more than one song to a Single type product.';
    END IF;
END;

//
DELIMITER ;

